Put our products to the test, exploit their great features and cook an unlimited number of menus!

The De’Longhi Recipe Book is the new, free App - for smartphones and tablets - collecting all the recipes for your De’Longhi cooking appliances. 
The De’Longhi Recipe Book is a complete cooking tool:
● a large, and always increasing, number of recipes;
● easy-to-use, can be taken everywhere;
● with recipes from all over the world;
● all recipes tested by a chef;
● eat better with direct control on calories;
● share your cooking experience with your friends through social networks;
● save your Favourites in the dedicated area.

Новое мобильное приложение «Шоколадницы» — это единая программа лояльности для всех заведений сети. С его помощью вы сможете без труда найти ближайшее кафе, узнать о действующих акциях и специальных предложениях.

Что дает участие в программе лояльности:

- бонусы за каждый заказ, которыми можно оплачивать следующие покупки (до 50% от суммы чека);
- кэшбек 10%;
- кофе (размера S) в подарок после первой покупки;
- 200 бонусов в подарок за 5 дней до дня рождения;
- «штампики»: каждый 10-й кофе, завтрак, ланч и ужин — бесплатно;
- персональные акции: пуш-уведомления с выгодными предложениями;
- абонементы и подарочные карты, которые можно приобрести в приложении и подарить в электронном виде.

«Burger King Беларусь» — удобное приложение для заказа еды.

Проголодались?
Установите официальное мобильное приложение “Burger King Беларусь"!

Заказывайте бургеры и оплачивайте в несколько касаний. Больше не нужно стоять в очереди: можете заказать в приложении, пройти в зону выдачи и показать код заказа из SMS!

Бесплатная служба доставки бургеров по всей Беларуси. Установите приложение и получайте приятные бонусы и купоны на доставку — проводим акции каждую неделю! 

Возможности приложения “Burger King Беларусь”:

∙ Оформление заказа в ресторане и на драйве;
∙ Оформление заказа на доставку еды;
∙ Оформление отложенного заказа доставки к заданному времени;
∙ Оплата банковскими картами прямо из приложения;
∙ Доступ к истории всех заказов;
∙ Купоны, акции и скидки при заказе в ресторанах и на доставку;
∙ Возможность быстро находить ближайшие рестораны.

